const icons = {
	home: Home,
	bell: Bell,
	compass: Compass,
	"doller-earn": DollerEarn,
	logout: Logout,
	message: Message,
	"public-access": PublicAccess,
	settings: Settings,
	wallet: Wallet,
	"ai-image": AiImage,
	user: User,
	"user-plus": UserPlus,
	"user-plus-alt": UserPlusAlt,
	"user-check": UserCheck,
	"user-edit": UserEdit,
	"user-circle": UserCircle,
	search: Search,
	search2: Search2,
	"arrow-left": ArrowLeft,
	"arrow-right": ArrowRight,
	heart: Heart,
	"heart-alt": HeartAlt,
	bookmark: Bookmark,
	swap: Swap,
	quest: Quest,
	history: History,
	"hand-mike": HandMike,
	globe: Globe,
	verify: Verify,
	content: Content,
	gender: Gender,
	image: Image,
	price: Price,
	payment: Payment,
	privacy: Privacy,
	question: Question,
	ellipsis: Ellipsis,
	"camera-plus": CameraPlus,
};

// The Icon component that selects which icon to render based on the 'name' prop
export const Icon = ({ name, ...props }) => {
	const IconComponent = icons[name];
	if (!IconComponent) {
		// Optional: return a default icon or null if the icon name doesn't exist
		console.warn(`Icon ${name} does not exist.`);
		return null;
	}
	return <IconComponent {...props} />;
};
